import React from 'react'
import './heroVideo.css'

export default function HeroVideo(props)
{
    return(
        <div className="hero">
        <video className="media" id="hero-video" autoPlay="autoplay">
            <source src={props.src} type="video/mp4" />
        </video>
        </div>

    )
}
